    enc_size += __int8_t_encoded_array_size(NULL, 1);

    numbits = 0;
    numbits += 8; // field22
    numbits += 3; // field23
    numbits += 3; // field24
    enc_size += __bitfield_encoded_size(numbits);

    enc_size += __int8_t_encoded_array_size(NULL, 1);

    numbits = 0;
    numbits += 2; // field25
    numbits += 8; // field26
    numbits += 2; // field27
